            "name": "Lethal Repertoire",
            "desc": "<size=40><color=Title>Heavy Attack - Imminent Oblivion<\/color><\/size>nCarlotta activates <color=Highlight>Tinted Crystal<\/color> every 22s.nWhen Substance is full and <color=Highlight>Tinted Crystal<\/color> is activated, hold <color=Highlight>Normal Attack<\/color> to consume all Substance and cast Heavy Attack <color=Highlight>Imminent Oblivion<\/color>, after which <color=Highlight>Tinted Crystal<\/color> enters cooldown. nDeal <color=Ice>Glacio DMG<\/color> (considered Resonance Skill DMG), and reduce the cooldown of Resonance Skill <color=Highlight>Art of Violence<\/color> by 6s.n<size=10> <\/size>n<size=40><color=Title>Final Bow<\/color><\/size>nWhen Substance is full, enter the <color=Highlight>Final Bow<\/color> state.nIncrease the DMG Multiplier of Resonance Liberation <color=Highlight>Era of New Wave<\/color>, Resonance Liberation <color=Highlight>Death Knell<\/color>, and Resonance Liberation <color=Highlight>Fatal Finale<\/color> by 80%. This effect ends when Carlotta is switched off the field during <color=Highlight>Twilight Tango<\/color> or when <color=Highlight>Twilight Tango<\/color> ends.n<size=10> <\/size>n<size=40><color=Title>Substance<\/color><\/size>nCarlotta can hold up to 120 points of Substance.nCannot gain Substance while in <color=Highlight>Twilight Tango<\/color> triggered by Resonance Liberation.nRestore <SapTag=3>30<\/SapTag> {Cus:Sap,S=point P=points SapTag=3} of Substance upon casting Intro Skill <color=Highlight>Wintertime Aria<\/color>.nRestore <SapTag=5>10<\/SapTag> {Cus:Sap,S=point P=points SapTag=5} of Substance for every <SapTag=4>1<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=4} consumed upon casting Resonance Skill <color=Highlight>Chromatic Splendor<\/color>.nRestore <SapTag=5>10<\/SapTag> {Cus:Sap,S=point P=points SapTag=5} of Substance for every <SapTag=4>1<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=4} consumed upon casting Basic Attack <color=Highlight>Necessary Measures<\/color>.nConsume <SapTag=4>1<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=4} and restore <SapTag=12>10<\/SapTag> {Cus:Sap,S=point P=points SapTag=12} of Substance upon casting <color=Highlight>Dodge Counter<\/color>.n<size=10> <\/size>n<size=40><color=Title>Moldable Crystal<\/color><\/size>nCarlotta can hold up to 6 Moldable Crystals.nCannot gain Moldable Crystal while in <color=Highlight>Twilight Tango<\/color> triggered by Resonance Liberation.nRestore <SapTag=7>3<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=7} upon casting <color=Highlight>Basic Attack Stage 2<\/color>.nRestore <SapTag=11>3<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=11} upon casting <color=Highlight>Heavy Attack<\/color>.nRestore <SapTag=8>3<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=8} upon casting Mid-air Attack <color=Highlight>Customary Greetings<\/color>.nRestore <SapTag=13>3<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=13} upon casting Intro Skill <color=Highlight>Wintertime Aria<\/color>.nRestore <SapTag=9>3<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=9} upon casting Resonance Skill <color=Highlight>Art of Violence<\/color>.nRestore <SapTag=10>3<\/SapTag> Moldable {Cus:Sap,S=Crystal P=Crystals SapTag=10} upon a successful <color=Highlight>Dodge<\/color>."
